package main

import (
	"agile-helm/pkg/action"
	"agile-helm/pkg/actioncfg"
	"fmt"
)

func main()  {
	apiClientCertificateData := ""
	apiClientKeyData := ""
	host := "https://172.18.13.11:6443"
	actcfg, err := actioncfg.TLSActionCfg("agile-helm",host,apiClientCertificateData,apiClientKeyData)
	if err != nil {
		fmt.Println(err)
		return
	}
	list, err := action.NewList(actcfg).Run()
	if err != nil {
		fmt.Println(err)
		return
	}
	fmt.Println(list)
}
